import HighchartsReact from "highcharts-react-official";
import Highcharts from "highcharts";
import { useEffect, useState } from "react";
import DataProvider from "../services/DataProvider";

const SerbiaData = () => {
  const [data, setData] = useState([]);
  const [chartOptions, setChartOptions] = useState({});
  const buttons = ["Female", "Male", "Compare"];

  const dataFilter = (data, gender) => {
    let options = {
      title: { text: "Blood Pressure index for Serbia population" },
    };

    switch (gender) {
      case "BTSX":
        const seriesArray = data
          .filter(({ Dim1 }) => Dim1 === "BTSX")
          .map(({ TimeDimensionValue, NumericValue }) => [
            parseInt(TimeDimensionValue),
            NumericValue,
          ]);
        options = {
          ...options,
          series: { name: "Both Genders", data: seriesArray },
        };
        break;
    }
    setChartOptions(options);
  };

  useEffect(() => {
    const getData = async () => {
      const data = await DataProvider.getSerbiaData();
      setData(data);

      dataFilter(data, "BTSX");
    };
    getData();
  }, []);
  return (
    <div>
      <h2>Serbia Graph here</h2>
      {buttons.map((b, index) => {
        return (
          <button
            onClick={() => {
              dataFilter(data, b);
            }}
            key={index}
          >
            {b}
          </button>
        );
      })}
      <HighchartsReact highcharts={Highcharts} options={chartOptions} />
    </div>
  );
};

export default SerbiaData;
